import axios from 'axios';

export const getPhotos = () => {
    return axios.get('/api/photos')
};

export const getPhoto = id => {
    return axios.get(`/api/posts/${id}`)
};

export const getPostPhotos = id => {
    return axios.get(`/api/posts/${id}/photos`)
}
